Text:
@lilars: Two days ago, in Norway was Eurovision Song Contest, something I watch from childhood.

Well, Germany won with this song and last two days I watched and listened that like zillion times. As Germans say: Ohrwurm (ohr=ear wurm=worm).

Like Craig repeats when audience looks astonished: "Hey! I am European!" I can say that too. We are strange... LOL
